	FindNodeAPIConfig(context.Context, *FindNodeAPIConfigRequest) (*FindNodeAPIConfigResponse, error)
	// 修改某个节点的API相关配置
	UpdateNodeAPIConfig(context.Context, *UpdateNodeAPIConfigRequest) (*RPCSuccess, error)
